import React from "react";

function NewSale() {
    return (
        <div className="text-white">
            <div class="mb-6">
                <label for="large-input" className="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-300">Large input</label>
                <input type="text" id="large-input" className="block p-4 w-full text-white-900 bg-gray-50 rounded-lg border border-gray-300 sm:text-md focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" />
            </div>
            <div class="mb-6">
                <label for="default-input" className="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-300">Default input</label>
                <input type="text" id="default-input" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" />
            </div>
        </div>
    )
}

export default NewSale;
